import React, { Component } from 'react';
import './NavBar.css';

class NavBar extends Component {
  render() {
    return (
      <div className="Navbar">
        <span className="home">
          <p>athena</p>
        </span>
        <span className="tabs">
          <a href="/Schools">
            <p> schools </p>
          </a>
          <a href="/Companies">
            <p> companies </p>
          </a>
          <a href="/Assocs">
            <p> associations </p>
          </a>
          <a href="/Login">
            <p> login <img className="loginIcon" src={require('./login_icon.svg')} /> </p>
          </a>
        </span>
      </div>
    );
  }
}

export default NavBar;
